import { useState } from 'react'
import NavBar from './Navig/NavBar'
import Slider from './Slider/Slider'

const Header = ({ testDriveForm }) => {
  const [moduleTestDrive, setmoduleTestDrive] = useState('')

  const handlerMdlWindow = (data) => {
    setmoduleTestDrive(data)
  }

  testDriveForm(moduleTestDrive)

  return (
    <>
      <NavBar mdlWindow={handlerMdlWindow} />
      <Slider />
    </>
  )
}

export default Header
